import React from 'react';
import temple from '../img/temple-mini.png'

const style = {
    color: '#ffffff',
    backgroundColor: '#9e3500',
    backgroundImage: `url(${temple})`,
    backgroundSize: '100%',
    backgroundRepeat: 'no-repeat',
    minHeight: '100%',
    maxHeight: '100%',
};

export default function Home() {
    return (
        <div style={style}>
        ds\
        </div>
    );
}
